import React from 'react'

function SmsForm(props) {
    return (
        <div>
            <button className="btn btn-sm btn-secondary" onClick={() => props.back()}>Back to comm selection</button>
            <h5>This is the sms form</h5>
        </div>
    )
}

export default SmsForm;
